import React from 'react'

const InputForm = (props) => {
  return (
    <div className='inputForm'>
      <input type="text" placeholder='Paste link here to short it...' onChange={(event) => event.target.val }/>
      <button>Shorten</button>
    </div>
  )
}

export default InputForm
